html {
  filter: invert(1);
}

img {
  filter: invert(1) brightness(150%);
}

img:hover, .wpb_wrapper img, .wpb_video_widget, .vc_custom_1673595184452, .vc_custom_1641923729911 {
  filter: invert(1) brightness(100%);
}

.weather-img img, img.custom-logo, footer img {
